'suite/chrome/mailnews/compose/composeMsgs.properties:12598' => 'Kerberos/GSSAPI ტალონი მიუღებელი აღმოჩნდა SMTP სერვერისთვის %S. გთხოვთ გადაამოწმოთ თქვენი შესვლა - Kerberos/GSSAPI realm.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12599' => 'SMTP სერვერისთვის %S შერჩეული აუთენტიფიკაციის მეთოდი მიუღებელია. გთხოვთ შეცვალოთ «აუთენტიფიკაციის მეთოდი» დაფაზე «ანგარიშის პარამეტრები | სერვერის პარამეტრები».',
'suite/chrome/mailnews/compose/composeMsgs.properties:12592' => 'წერილის გაგზავნა ვერ ხერხდება SMTP სერვერთან %S კავშირის ვადის გასვლის გამო. სცადეთ კვლავ ან დაუკავშირდით თქვენი ქსელის ადმინისტრატორს.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12593' => 'წერილის გაგზავნა SMTP სერვერით %S ვერ ხერხდება გაურკვეველი მიზეზის გამო. გთხოვთ გადაამოწმოთ თქვენი სერვერის SMTP პარამეტრების მართებულობა და სცადეთ კვლავ ან დაუკავშირდით თქვენი ქსელის ადმინისტრატორს.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12590' => 'წერილის გაგზავნა ვერ ხერხდება რადგან დაკავშირება SMTP სერვერთან %S ვერ განხორციელდა. შესაძლოა სერვერი მიუწვდომელია ან უარყოფს SMTP კავშირს. გთხოვთ გადაამოწმოთ თქვენი სერვერის SMTP პარამეტრების მართებულობა და სცადეთ კვლავ ან დაუკავშირდით თქვენი ქსელის ადმინისტრატორს.',
'suite/chrome/mailnews/messenger.dtd:msgMenu.label' => 'წერილი',
'suite/chrome/mailnews/compose/composeMsgs.properties:12596' => 'SMTP სერვერისთვის %S ღია ტექსტური პაროლები მიუღებელია. გთხოვთ აუთენტიფიკაციის მეთოდისთვის მიუთითოთ პარამეტრი «დაშიფრული პაროლი» დაფაზე «ანგარიშის პარამეტრები | სერვერის პარამეტრები».',
'suite/chrome/mailnews/compose/composeMsgs.properties:12597' => 'ვერ ხერხდება აუთენტიფიკაცია SMTP სერვერზე %S. გადაამოწმეთ პაროლი და «აუთენტიფიკაციის მეთოდი» დაფაზე «ანგარიშის პარამეტრები | გამავალი სერვერი(SMTP)».',
'suite/chrome/mailnews/compose/composeMsgs.properties:12594' => 'როგორც ჩანს SMTP სერვერისთვის %S დაშიფრული პაროლები მიუღებელია. თუ ანგარიში ახლახანს გახსენით, გთხოვთ სცადოთ აუთენტიფიკაციის მეთოდისთვის მიუთითოთ პარამეტრი «პაროლის დაუცველად გადაცემა» დაფაზე «ანგარიშის პარამეტრები | სერვერის პარამეტრები». თუ ეს მუშაობდა და ახლა უეცრად აღარ ფუნქციონირებს, ეს ჩვეულებრივი სიმპტომია, რომ ვიღაცას თქვენი პაროლის მოპარვა შეეძლო.',
'suite/chrome/mailnews/compose/composeMsgs.properties:12595' => 'როგორც ჩანს SMTP სერვერისთვის %S დაშიფრული პაროლები მიუღებელია. თუ ანგარიში ახლახანს გახსენით, გთხოვთ აუთენტიფიკაციის მეთოდისთვის მიუთითოთ პარამეტრი «ჩვეულებრივი პაროლი» დაფაზე «ანგარიშის პარამეტრები | სერვერის პარამეტრები». თუ ეს მუშაობდა და ახლა უეცრად აღარ ფუნქციონირებს, გთხოვთ მიმართოთ ელფოსტის ადმინს ან პროვაიდერს.',
