'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term7' => 'ეს პირობები იმართება კალიფორნიის შტატის (აშშ) კანონმდებლობით, გარდა მისი ხელშეკრულებებთან კოლიზიის შემთხვევებისა. თუ ამ პირობებიდან რომელიმე ნაწილი მცდარი ან შეუსრულებადი აღმოჩნდა, დანარჩენი ნაწილები ძალას ინარჩუნებენ. შეუსაბამობის შემთხვევაში თარგმნილსა და ინგლისურ ვერსიას შორის, ძალაში ინგლისური ვერსია რჩება.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term4' => 'მომსახურებები მოწოდებულია «როგორც არის და რაც არის.»  &amp;vendorShortName;, მისი შემქმნელები, ლიცენზორები და გამავრცელებლები იხსნიან ყველა სახის, ღია თუ შეფარულ, შეუზღუდავის ჩათვლით, პასუხისმგებლობას მომსახურებების კომერციულობასა და მორგებაზე თქვენი საჭიროებისამებრ.  მომსახურებების, როგორც თქვენი საჭიროებისამებრ შემრჩევს მომსახურებების ხარისხსა და წარმადობაზე სრული რისკი მთლიანად თქვენ გეკისრებათ. ზოგიერთი კანონმდებლობა არ იძლევა ირიბი პასუხისმგებლობის გამორიცხვის ან შეზღუდვის უფლებას, ამგვარად ეს უარყოფა თქვენ ვერ შეგეხებათ.',
'toolkit/chrome/global/aboutRights.dtd:rights.webservices-term5' => 'გარდა კანონის მოთხოვნების გამონაკლისებისა, &amp;vendorShortName;, მისი შემქმნელები, ლიცენზორები და გამავრცელებლები პასუხს არ აგებენ ირიბი, განსაკუთრებული, შემთხვევითი, გამომდინარე, სადამსჯელო ან სანიმუშო დაზიანებებზე, რომლებიც &amp;brandShortName; და მისი მომსახურებებით სარგებლობის შედეგად შეიძლება წარმოიქმნას.  კოლექტიური პასუხისმგებლობა ამ პირობების მიხედვით არ შეიძლება აჭარბებდეს $500 (ხუთას დოლარს). ზოგიერთი კანონმდებლობა არ იძლევა გარკვეული დაზიანებების გამორიცხვის ან შეზღუდვის უფლებას, ამგვარად ეს გამონაკლისი და შეზღუდვა თქვენ ვერ შეგეხებათ.',
